import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  border: 1.5px solid #FEA82F;
  border-radius: 10px;
  display: inline;

  .asdf {
    display: inline;
  }

`;

const Summary = (props) => {
  return <>
  <Wrapper>
    
      <img className="asdf" src="assets/images/summary.png" alt="img" />
    <div className="qwer">
      <h1>temp</h1>
    </div>
    
  </Wrapper>
    
  </>;
};

export default Summary;
